import React from "react";
import HeadCon from "../containers/newheader";
import { SearchCon } from "../component";
import * as Icon from "react-feather";

export default function Search({...rest}) {
    return (
        <>
                <HeadCon/>
                <SearchCon>
                    <SearchCon.SearchTitle>What Are You Looing For?</SearchCon.SearchTitle>
                    <SearchCon.SearchForm>
                        <SearchCon.Bar placeholder="search something.."/>
                        <SearchCon.SearchButton>
                            <Icon.Search/>
                        </SearchCon.SearchButton>
                    </SearchCon.SearchForm>
                </SearchCon>
        </>
    )
}
